  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130772 includes physical
  and profile data collected aboard the NAVIGATION RESPONSE TEAM 5 during project
  OPR-B310-NRT5-04 in the North Atlantic Ocean from 2005-03-28 to 2006-10-30. These
  data include SOUND VELOCITY. The instruments used to collect these data include
  sound velocimeter. These data were collected and submitted by the NOAA Office of
  Coast Survey in support of hydrographic multibeam surveys to meet NOAA charting
  requirements.\",\n\t\"owner_org\": \"9cda5205-d632-4814-96e7-a4ab5e0dce85\",\n\t\"extras\":
